import { CardMedia, makeStyles } from "@material-ui/core";
import React from "react";

const useStyles = makeStyles((theme)=>({
    media: {
        
        width:'inherit',
        paddingTop: '56.25%', // 16:9
        borderRadius:'0.2rem'
  
      }
}))
const Picture = ()=>{
    const classes = useStyles()
    return (
        <CardMedia
        className={classes.media}
        image={require()}
      />
    )
};

export default Picture;
